INSERT INTO `txt_ratings` VALUES (1,'1','Ноутбуки. Лидеры продаж в России.','Ноутбуки. Рейтинг популярности моделей (Top 10) за апрель 2021. Составлен по данным реальных продаж в России.','Самой продаваемой моделью за апрель 2021 стал недорогой 14-дюймовый ноутбук HP 14s-fq0 на базе процессоров AMD Renior.\r\nНо в рейтинг также попали и гораздо более дорогие модели, как потребительской, так и коммерческой направленности, включая Apple Macbook Air 13 последней версии (Late 2020). \r\nКстати, большинство победителей абсолютного зачета - устройства на базе процессоров AMD.','<p>В апреле 2021 на российском рынке уже чувствовалось влияние <strong>дефицита</strong>, который постепенно охватывает все большее число сегментов электроники. Это связано с общемировыми проблемами в области производства полупроводниковых элементов - от сложных микропроцессоров до простейших микросхем. <strong>Но&nbsp;именно на мобильные ПК</strong> - как самый популярный &quot;компьютерный&quot; товар&nbsp;- эти проблемы оказывают наиболее сильное влияние.</p>\r\n\r\n<div class=\"inarticle_cit1\">\r\n<p>Подобные обстоятельства, обыкновенно влияют на локальный рынок (любой) следующим образом: выигрывают в подобном случае&nbsp;не те, кто предложил <em>оптимальный продукт по лучшей цене</em>, а те кому <em>удалось привезти</em> модели в товарном количестве. Потребитель же берет то, что есть.</p>\r\n</div>\r\n\r\n<p>В середине весны российский рынок ноутбуков еще не скатился в объятья дефицита в полной мере,&nbsp;но&nbsp;чувствуется, что к лету мы будем иметь как раз такую - чисто &quot;складскую&quot; ситуацию.</p>\r\n\r\n<h3>Лидер:&nbsp;HP 14s-fq0</h3>\r\n\r\n<p><img alt=\"Ноутбук HP 14s-fq0\" src=\"/static/marketability/pict/rate/hp_14s-fq0.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>Ноутбук HP 14s-fq0</p>\r\n\r\n<p>Самой продаваемой моделью стал универсальный&nbsp;14-дюймовый&nbsp;лэптоп HP 14s-fq0.&nbsp;Он же является и самой недорогой моделью из Top-перечня.&nbsp;</p>\r\n\r\n<p>Система построена на процессорах&nbsp;AMD Ryzen поколения Renior (4000 серия) с интегрированной графикой.&nbsp;</p>\r\n\r\n<p>Базовая модель&nbsp;fq0 имеет множество различных конфигураций.</p>\r\n\r\n<div class=\"inarticle_disclimer\">\r\n<p>Согласно системе наименования потребительских ноутбуков&nbsp;HP, в названии модели, например,&nbsp;14s-fq0091ur,<br />\r\nпервые цифры &quot;14&quot; - диагональ экрана;<br />\r\nдве буквы &quot;fq&quot;- название&nbsp;серии, т. н.&nbsp;шасси или платформа:&nbsp;корпус и материнская плата;<br />\r\nпервая цифра &quot;0&quot; - поколение модели в рамках серии;<br />\r\nостальные три цифры &quot;091&quot; - артикул, номер конкретной конфигурации с определенной моделью процессора, объемами ОЗУ и&nbsp;накопителя, установленной ОС и проч;<br />\r\n&quot;ur&quot; - российская локализация.</p>\r\n</div>\r\n\r\n<h3>Рейтинг моделей ноутбуков по данным реальных продаж в России.<br />\r\nАпрель&nbsp;2021 года</h3>\r\n\r\n<p><em>(Сортировка списка - по возрастанию цены.)</em></p>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table cellpadding=\"4\" class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td>Цена, руб.</td>\r\n			<td>Произв. процессора</td>\r\n			<td>Графика</td>\r\n			<td>Экран</td>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"/Nb/4687\">HP&nbsp;HP 14s-fq0000</a>&nbsp;♔</th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>37&nbsp;773</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/3859\">Lenovo&nbsp;IdeaPad S145-15IIL</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>40&nbsp;039</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/3461\">HP&nbsp;HP 15s-eq1000</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>41&nbsp;379</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/3881\">Lenovo&nbsp;IdeaPad L340-15API</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>42&nbsp;550</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4340\">Lenovo&nbsp;IdeaPad 3 15ARE05</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>46&nbsp;896</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4943\">HP&nbsp;Essential 250 G8 Core</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>51&nbsp;450</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4691\" target=\"_blank\">HP Pavilion 15-eh0</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>55&nbsp;714</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4375\">HP&nbsp;ProBook 445 G7</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>59&nbsp;543</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4404\">Dell&nbsp;Latitude 3410</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>64&nbsp;299</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4787\">Apple&nbsp;Macbook Air 13 2020 (M1)</a></th>\r\n			<td>\r\n			<div class=\"td_empty\">&nbsp;</div>\r\n			</td>\r\n			<td><strong>144&nbsp;348</strong></td>\r\n			<td>Apple</td>\r\n			<td>Встроенная</td>\r\n			<td>13</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p>⚠ <em>Цены - средние розничные на середину Апреля 2021. К настоящему моменту могут быть иные.</em></p>\r\n\r\n<h3>Недорогие ноутбуки</h3>\r\n\r\n<p>Вполне естественно, что среди лидеров сбыта присутствуют дешевые модели.</p>\r\n\r\n<p>Относительно недорогие ноутбуки <strong>розничной направленности</strong>, типа:</p>\r\n\r\n<p>Lenovo IdeaPad S145-15IIL, HP 15s/14s, Pavilion 15-eh0 и Lenovo IdeaPad 3 15ARE05;</p>\r\n\r\n<p>Также имеются в списке модели скорее <strong>&quot;для работы&quot;</strong>, бюджетные деловые модели: HP 250 G8.</p>\r\n\r\n<p>Однако, здесь мы можем видеть и бизнес-модели, уровня, скорее для менеджмента: Dell Latitude 3410. или HP ProBook 445 G7.</p>\r\n\r\n<h3>Платформа (процессоры,&nbsp;CPU)</h3>\r\n\r\n<p>Самым же дорогостоящим в списке, но далеко не последним по числу отгрузок, стал бестселлер этого года <strong>Apple Macbook Air 13 Late 2020</strong> на базе новейшего ARM-процессора Apple Silicon&nbsp;M1. Переход &quot;яблочных&quot; на собственные процессоры с начала этого года дал мощный толчок продажам MacBook.</p>\r\n\r\n<p>Кстати, заметно явное преимущество моделей на базе процессоров <strong>AMD</strong>. Теперь продуктами с процессорами &quot;альтернативного&quot; вендора интересуются не только частные пользователи, но и коммерческий сектор: пример тому - деловой <strong>HP ProBook 445 G7</strong>.</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбук для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>','Nb','2021-05-30','/static/marketability/pict/rate/hp_14s-fq0.jpg',1),(2,'2','Игровые ноутбуки. Лидеры продаж за апрель.','Ноутбуи с игровыми возможностями. Общий рейтинг ноутбуков для игр,а также рейтинг продвинутых моделей со старшими видеокартами.','В общем зачете победила модель Lenovo IdeaPad 3 Gaming 15ARH05 на базе процессоров AMD и графики GTX 1650 Ti. Среди более дорогостоящих геймерских ноутбуков самой большой популярностью пользовалась модель от Asus - TUF Gaming FX516P (PR/PM) на базе Intel и NVIDIA RTX 3000.','<h2>Рейтинг популярности ноутбуков для игр в России, Апрель 2021 года</h2>\r\n\r\n<p><em>(Источник: <a href=\"http://www.itbestsellers.ru\">ITResearch</a>, <a href=\"/Nb/?GO_Game=Yes&amp;tabs=marketability\">Allgid.ru</a>.)</em></p>\r\n\r\n<p>Под номинацию <strong><a href=\"/Nb/?GO_Game=Yes&amp;tabs=marketability\" target=\"_blank\">&laquo;Игровой ноутбук&raquo;</a></strong> попадают как устройства с видеокартами среднего класса nVidia GTX или AMD RX540/RX550, так и &laquo;настоящие&raquo; продвинутые геймерские ноутбуки с действительно мощными GPU серий nVidia RTX.</p>\r\n\r\n<p>Понятно, что по продажам в штуках лидируют более дешевые модели с относительно&nbsp;недорогими видеокартами. В то время как представители специальных брендовых геймерских серий в массе своей остаются за бортом. Еще бы: не каждый может себе позволить ноутбук стоимостью от 100 тыс. руб.&nbsp;<br />\r\nЭто несправедливо, по отношению к <strong>&laquo;профи-геймерам</strong>&raquo;. Поэтому мы разделили наш рейтинг на две позиции:&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Общий рейтинг моделей игровых ноутбуков.&nbsp;(C&nbsp;дискретной&nbsp;графикой начиная от NVIDIA GTX).</li>\r\n	<li>Рейтинг топовых игровых ноутбуков. (С&nbsp;видеокартами NVIDIA RTX).&nbsp;</li>\r\n</ol>\r\n\r\n<h2>1. Общий рейтинг моделей игровых ноутбуков&nbsp;</h2>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>Данные отсортированы по возрастанию цены.&nbsp;<br />\r\n⚠ Цены - средние розничные на середину Апреля 2021. К настоящему моменту могут быть иные.&nbsp;<br />\r\nКроме того, стоит учитывать, что в случае с игровыми моделями, средняя цена &ndash; это зачастую действительно &laquo;средняя по больнице&raquo;. Фактически каждая базовая модель имеет множество артикулов. И цены на младшую и старшую конфигурацию модели могут различаться двукратно и даже больше.&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<td>Цена*, руб.</td>\r\n			<td>Произв. процессора</td>\r\n			<td>Графика</td>\r\n			<td>Экран</td>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4103\">MSI&nbsp;MSI GF63C</a></th>\r\n			<td><strong>68&nbsp;837</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1050, GTX1050 Ti</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><strong>♔&nbsp;</strong><a href=\"http://127.0.0.1:8000/Nb/4419\">Lenovo&nbsp;IdeaPad Gaming 3 15ARH05</a>&nbsp;</th>\r\n			<td><strong>70&nbsp;994</strong></td>\r\n			<td>AMD</td>\r\n			<td>GTX1650, GTX1650 Ti</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4339\">HP&nbsp;Pavilion 15-ec1000</a></th>\r\n			<td><strong>71&nbsp;146</strong></td>\r\n			<td>AMD</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/2693\">Acer&nbsp;Aspire A715-75G</a></th>\r\n			<td><strong>72&nbsp;438</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4341\">Lenovo&nbsp;IdeaPad Gaming 3 15IMH05</a></th>\r\n			<td><strong>78&nbsp;503</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4120\">MSI&nbsp;MSI GF75C</a></th>\r\n			<td><strong>82&nbsp;472</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1050</td>\r\n			<td>17</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/2704\">Acer&nbsp;Aspire AN515-55</a></th>\r\n			<td><strong>91&nbsp;061</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1650, RTX2060, RTX3060</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/3649\">HP&nbsp;Pavilion 17-cd1000</a></th>\r\n			<td><strong>91&nbsp;171</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1650, GTX1660</td>\r\n			<td>17</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4916\">Asus&nbsp;Asus FX516P</a></th>\r\n			<td><strong>124&nbsp;796</strong></td>\r\n			<td>Intel</td>\r\n			<td>RTX3050 Ti, RTX3060, RTX3070</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4963\">MSI&nbsp;MSI GP66CML 10U</a></th>\r\n			<td><strong>159&nbsp;990</strong></td>\r\n			<td>Intel</td>\r\n			<td>RTX3070</td>\r\n			<td>15</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Лидер общего зачета: Игровой ноутбук Lenovo IdeaPad Gaming 3 15ARH05</h3>\r\n\r\n<p>Самым продаваемым ноутбуком с игровыми возможностями стал 15-дюймовый лаптоп IdeaPad Gaming 3 15ARH05 от Lenovo. Это игровое дополнение младшей серии потребительских ноутбуков Lenovo IdeaPad 3.</p>\r\n\r\n<p><img alt=\"Lenovo IdeaPad 3 Gaming 15ARH05\" src=\"/static/marketability/pict/rate/lenovo_ip3_gm_15ARH05.jpg\" /><br />\r\nМодель построена на базе процессоров AMD Renior-H (серия 4000H) и оснащается видеокартами класса мэйнстрим NVIDIA GTX 1650 / GTX 1650 Ti с 4 Гб видеопамяти.<br />\r\nIP3 15ARH05 имеет несколько комплектаций&nbsp;на базе процессоров&nbsp;Ryzen 5 4600H или Ryzen 7 4800H, с ОЗУ от 8 до 16 Гб, накопителем SSD или гибридным накопителем SSD + HDD.<br />\r\nСтоимость различных конфигураций колеблется<strong> от 55 до 95 тыс. руб.</strong></p>\r\n\r\n<h2>2.&nbsp;Рейтинг топовых игровых ноутбуков.</h2>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<td>Цена*, руб.</td>\r\n			<td>Произв. процессора</td>\r\n			<td>Графика</td>\r\n			<td>Экран</td>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4104\">MSI&nbsp;MSI GF65C</a></th>\r\n			<td><strong>82&nbsp;780</strong></td>\r\n			<td>Intel</td>\r\n			<td>RTX2060</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/2704\">Acer&nbsp;Aspire AN515-55</a></th>\r\n			<td><strong>91&nbsp;061</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1650, RTX2060, RTX3060</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/5007\">Acer&nbsp;Aspire AN515-45</a></th>\r\n			<td><strong>101&nbsp;249</strong></td>\r\n			<td>AMD</td>\r\n			<td>RTX3060</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4961\">MSI&nbsp;MSI GF65CML 10U</a></th>\r\n			<td><strong>102&nbsp;993</strong></td>\r\n			<td>Intel</td>\r\n			<td>RTX3060</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4903\">MSI&nbsp;Stealth 15M A11S</a></th>\r\n			<td><strong>111&nbsp;937</strong></td>\r\n			<td>Intel</td>\r\n			<td>RTX2060</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th>♔&nbsp;<a href=\"http://127.0.0.1:8000/Nb/4916\">Asus&nbsp;Asus FX516P</a>&nbsp;</th>\r\n			<td><strong>124&nbsp;796</strong></td>\r\n			<td>Intel</td>\r\n			<td>RTX3050 Ti, RTX3060, RTX3070</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/4963\">MSI&nbsp;MSI GP66CML 10U</a></th>\r\n			<td><strong>159&nbsp;990</strong></td>\r\n			<td>Intel</td>\r\n			<td>RTX3070</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5036\">Lenovo Legion 5 15ACH6H</a></th>\r\n			<td>161&nbsp;200</td>\r\n			<td>AMD</td>\r\n			<td>RTX3060, RTX3070</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4920\">Asus ROG Strix Scar G733Q</a></th>\r\n			<td>171&nbsp;847</td>\r\n			<td>AMD</td>\r\n			<td>RTX3080</td>\r\n			<td>17</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5013\">Asus&nbsp;Zephyrus GA503Q</a></th>\r\n			<td>187&nbsp;660</td>\r\n			<td>AMD</td>\r\n			<td>RTX3060, RTX3070, RTX3080</td>\r\n			<td>15</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n\r\n<h3>Лидер среди топовых игровых моделей Asus TUF Gaming FX516P</h3>\r\n\r\n<p>Другое название модели по каталогу производителя Asus TUF Dash F15&nbsp;FX516PM / FX516PR.</p>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>В целом же семейство ноутбуков Asus TUF (англ. Tough - крутой, крепкий, прочный) серии FX ориентированы на массовый пользовательский сегент - в широкой номенклатуре игровых ноутбуков Asus - это семейство ближе к младшему. Игровые сценарии - не единственная направленность этих лэптопов - они также ориентируется на дизайнеров, обработку видео, разработку приложений и проч. &quot;тяжелые&quot; нагрузки.</p>\r\n</div>\r\n\r\n<p><img alt=\"Asus TUF Dash FX516P\" src=\"/static/marketability/pict/rate/asus_tuf_516p.jpg\" /></p>\r\n\r\n<p>Модель FX516P базируется на последнем (11-м) поколении мобильных процессоров Intel Core Tiger Lake-H для ноутбуков расширенной конфигурации. И видеокартах последнего поколения NVIDIA Ampere (RTX 30-серии).&nbsp;<br />\r\nНаиболее распространенные конфигурации - процессоры Core i5 11300H / RTX 3060 4 ГБ ВОЗУ или&nbsp; Core i7&nbsp;11370H / RTX 3070 6&nbsp;ГБ ВОЗУ.&nbsp;</p>\r\n\r\n<p>Серия оснащается FHD-дисплеем с высокой частотой обновления 240 Гц, имеет ударопрочный корпус.</p>\r\n\r\n<p>Цены на различные конфигурации колеблятся <strong>от 95 до 140 тыс. руб.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбук для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?GO_Game=Yes&amp;tabs=marketability\">Top-20 игровых моделей</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?GO_Game=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?GO_Game=Yes&amp;tabs=marketability\">Игровой</a></div>\r\n</div>','Nb','2021-06-06','/static/marketability/pict/rate/lenovo_ip3_gm_15ARH05.jpg',1),(3,'3','Ноутбуки - лидеры продаж в России, Рейтинг, Top-10, Май, 2021','Рейтинг самых популярных моделей ноутбуков по данным данным продаж в России за Май 2021 года','В мае 2021 года на российском рынке улучшились позиции недорогих моделей. Так, в сравнении  средняя стоимость устройства в списке лидеров сократилась с 49 до 45,5 тыс. руб. \r Особенно усердствовала в направлении снижения цен HP. Ее 15-дюймовая модель HP 15s-eq1 на базе AMD Athlon/Ryzen и стала победителем в общем зачете.','<p>В мае 2021 года на российском рынке улучшились позиции недорогих моделей. Так, в сравнении <a href=\"/rate/Nb/1\">с апрелем</a> средняя стоимость устройства в списке лидеров сократилась с 49 до 45,5 тыс. руб. (Без учета модели от Apple, чей высокий ценник существенно влияет на средние показатели.)<br />\r\nОсобенно усердствовала в этом направлении снижения цен компания HP, &nbsp;все последние месяцы сохраняющая лидерство на нашем рынке ноутбуков. Ее 15-дюймовая модель HP 15s-eq1 на базе AMD Athlon/Ryzen стала победителем в общем зачете.</p>\r\n\r\n<h2>Рейтинг ноутбуков по данным реальных продаж в России. Май 2021 года.</h2>\r\n\r\n<p><em>Источник: Allgid.ru, ITResearch</em></p>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>⚠ Данные отсортированы по возрастанию цены.&nbsp;<br />\r\nЦены - средние розничные на середину Мая 2021. К настоящему моменту могут быть иные.&nbsp;<br />\r\nКроме того, стоит учитывать, что многие модели имеют несколько комплектаций и реальные цены могут существенно отличаться от средней.</p>\r\n</div>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<td>Цена*, руб.</td>\r\n			<td>Произв. процессора</td>\r\n			<td>Графика</td>\r\n			<td>Экран</td>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/3420\">HP 14s-dq0000</a></th>\r\n			<td><strong>26&nbsp;515</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/4687\">HP 14s-fq0000</a></th>\r\n			<td><strong>33&nbsp;479</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/3776\">Lenovo&nbsp;IdeaPad 3 15ADA05</a></th>\r\n			<td><strong>36&nbsp;079</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/4689\">HP 15-dw1000 Core</a></th>\r\n			<td><strong>36&nbsp;757</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"https://allgid.ru/Nb/3461\">♔&nbsp;HP 15s-eq1000</a></th>\r\n			<td><strong>37&nbsp;481</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/5025\">HP 14s-fq1000</a></th>\r\n			<td><strong>44&nbsp;304</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/5046\">Acer&nbsp;Aspire A715-42G</a></th>\r\n			<td><strong>58&nbsp;990</strong></td>\r\n			<td>AMD</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/4404\">Dell&nbsp;Latitude 3410</a></th>\r\n			<td><strong>60&nbsp;301</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/4419\">Lenovo&nbsp;IdeaPad Gaming 3 15ARH05</a></th>\r\n			<td><strong>71&nbsp;643</strong></td>\r\n			<td>AMD</td>\r\n			<td>GTX1650, GTX1650 Ti</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Nb/4787\">Apple&nbsp;Macbook Air 13 2020 (M1)</a></th>\r\n			<td><strong>142&nbsp;345</strong></td>\r\n			<td>Apple</td>\r\n			<td>Встроенная</td>\r\n			<td>13</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p>Большая часть представленных моделей относятся к <strong>младшим потребительским</strong> сериям в линейке вендоров: скажем, HP 14s/15s, Lenovo IdeaPad 3.&nbsp;<br />\r\nБольшая часть моделей базируется на процессорах AMD со встроенной графикой. Есть, впрочем, представители и самой дешевой части ноутбучного ассортимента с процессорами Intel Atom Gemini Lake (Pentium серии N) - HP 14s-dq0000/<br />\r\nОднако, в рейтинг попали и более продвинутые, <strong>игровые</strong> ноутбуки от Acer и Lenovo. (Конечно - это не &ldquo;настоящие&rdquo; геймерские машины с серьезными видеокартами. Тем не менее - это достаточно производительные системы с дискретной графикой среднего класса для игр и <strong>создания контента</strong>.)<br />\r\nТакже в рейтинге выделяются <strong>корпоративные</strong> ноутбуки Dell Latitude и, конечно, <strong>элита</strong>: Apple Macbook Air на базе <a href=\"https://zen.yandex.ru/media/id/60a9bdd6a4aad1743d7ea041/60e21ce47601597c33f8fa4a\" target=\"_blank\">собственных процессоров Apple M1.</a></p>\r\n\r\n<h2>Лидер: HP 15s-eq1000</h2>\r\n\r\n<p><br />\r\nМодель HP 15s-eq1 относится к бюджетным в ассортименте консьюмерских (потребительских) ноутбуков производителя.<br />\r\nПри этом машина выполнена в тонком и облегченном дизайне (что обозначается индекcом s &nbsp;в наименовании 15s.) Вес ноутбука - 1,7 кг.</p>\r\n\r\n<p><img alt=\"HP 15s-eq1000\" src=\"/static/marketability/pict/rate/hp_15s-eq1.jpg\" style=\"width:100%\" /><br />\r\nНачинка включает процессоры серии AMD &nbsp;уже далеко не нового поколения Picasso (3000 серия.) Предлагаются на выбор конфигурации&nbsp;от младших процессоров Athlon Silver 3050U с 4 ГБ памяти&nbsp;до Ryzen 5 4500U с 8 ГБ.<br />\r\nЦены на модель в зависимости от конфигурации колеблются от 25 до 45 тыс. руб.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбук для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-link\">\r\n<h3><a href=\"/rate/Nb/1\">Ноутбуки. Лидеры продаж в России за Апрель 2021.</a></h3>\r\n</div>','Nb','2021-07-07','/static/marketability/pict/rate/hp_15s-eq1.jpg',1),(4,'4','Рейтинг популярности ультрабуков в России. Top-10, Май`2021','Самые продаваемые компактные ноутбуки класса ультрабук. Рейтинг по данным реальных продаж в России в Мае 2021 г. Цены, характеристики.','\"Ультрабуки\" - компактные, легкие, но вполне полноценные по внутренней начинке ноутбуки с экранами от 12\" до 14\" включительно. Анализируем, какие модели пользовались наибольшим спросом в России в мае 2021 г. \r\nЛидером сегмента стал относительно дешевый ноутбук серии HP 14s.\r\nТакже посмотрим, что делается со спросом на элиту современных ноутбуков - модели со стикером Intel Evo.','<p>&quot;Ультрабуки&quot; - компактные, легкие, но вполне полноценные по внутренней начинке ноутбуки с экранами от 12&quot; до 14&quot; включительно.&nbsp;</p>\r\n\r\n<p>На сегодня термин &quot;Ультрабук&quot; прочно вошел в обиход. К этой категории ноутбуков относят модели относительно компактного размера, которые можно брать с собой.</p>\r\n\r\n<p>На сегодня устройства этого плана могут быть построены на любых полноценных процессорах: Intel Core, AMD Ryzen, Apple M1. Однако, мы <strong>не относим</strong> к ультрабукам&nbsp;самые дешевые ноуты, скажем на чипах Atom.</p>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>✎ В изначальном варианте термин Ultrabook был предложен Intel. И, понятно, исключительно для своих процессоров Core со сниженным энергопотреблением. Так обозначались высококачественные, с т. з. Intel, соответствующие четкой спецификации тонкие и легкие устройства. <a href=\"https://zen.yandex.ru/media/id/60a9bdd6a4aad1743d7ea041/intel-evo-chto-znachit-eta-nakleika-na-korpuse-noutbuka-60f1957f4b5d8b6f293ebf2f\" target=\"_blank\">Подробности этой истории изложены в нашей статье на Дзен</a>.<br />\r\nНо это было давно. Теперь слово &quot;Ультрабук&quot; стало общеупотребительным применительно к устройствам определенных габаритов.<br />\r\nЧто же до Intel, компания придумала новую&nbsp;спецификацию отмеченную стикером на корпусе&nbsp;для элитных компактных устройств - Evo. Они <a href=\"#evo\">упоминаются в этой статье отдельно</a>.</p>\r\n</div>\r\n\r\n<h2>Рейтинг самых популярных ультрабуков.<br />\r\nTop-10, Май 2021.</h2>\r\n\r\n<p><em>(Рейтинг составлен по данным реальных продаж российских дистрибьюторов и крупнейших розничных сетей. Источник: аналитическая компания ITResearch, Allgid.ru.)</em></p>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>⚠ Данные отсортированы по возрастанию цены.&nbsp;<br />\r\nЦены - средние розничные на середину Мая 2021. К настоящему моменту могут быть иные.&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<td>Цена*, руб.</td>\r\n			<td>Произв. процессора</td>\r\n			<td>Графика</td>\r\n			<td>Экран</td>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"/Nb/4687\">HP 14s-fq0000</a></th>\r\n			<td><strong>33&nbsp;479</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5025\">♔&nbsp;HP 14s-fq1000</a></th>\r\n			<td><strong>44&nbsp;304</strong></td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4864\">HP&nbsp;Pavilion x360 14-dw1000</a></th>\r\n			<td><strong>53&nbsp;969</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4404\">Dell&nbsp;Latitude 3410</a></th>\r\n			<td><strong>60&nbsp;301</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/3681\">HP&nbsp;ProBook 430 G7</a></th>\r\n			<td><strong>61&nbsp;876</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>13</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5069\">Lenovo&nbsp;ThinkPad T14 Gen2</a></th>\r\n			<td><strong>106&nbsp;540</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4003\">Lenovo&nbsp;ThinkPad T14 Gen1</a></th>\r\n			<td><strong>134&nbsp;924</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>14</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4787\">Apple&nbsp;Macbook Air 13 2020 (M1)</a></th>\r\n			<td><strong>142&nbsp;345</strong></td>\r\n			<td>Apple</td>\r\n			<td>Встроенная</td>\r\n			<td>13</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4788\">Apple&nbsp;Macbook Pro 13 2020 (M1)</a></th>\r\n			<td><strong>165&nbsp;903</strong></td>\r\n			<td>Apple</td>\r\n			<td>Встроенная</td>\r\n			<td>13</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/2849\">Apple&nbsp;Macbook Pro 13 (IL)</a></th>\r\n			<td><strong>202&nbsp;487</strong></td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n			<td>13</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>В рейтинге представлены продукты самых разных ценовых категорий и&nbsp;позиционирования.<br />\r\nОтрывают его, естественно, бюджетные продукты: 14-дюймовые модели распространенной&nbsp;линейки HP 14s.</p>\r\n\r\n<p>Также в рейтинг попал потребительский мультимедийный ноутбук-трансформер с поворотным экраном:&nbsp;Pavilion x360 14-dw1.</p>\r\n\r\n<p>Прочие модели уже являются представителями коммерческих линеек. Это бизнес-ноутбуки младшего класса &nbsp;Dell Latitude и HP Probook, ну и, конечно, классика корпоративных серий -&nbsp;Lenovo ThinkPad T14. Любовь деловых пользователей к ультрабукам, особенно как раз к 14-дюймовым - понятна. Это, одновременно, и вполне полноценный рабочий инструмент, и выездная модель для командировок и переговоров.&nbsp;</p>\r\n\r\n<p>Ну а наиболее дорогостоящей частью рейтинга являются сразу три модели Apple Macbook 13&quot;&nbsp;- как на собственных процессорах ARM M1, так и складские остатки&nbsp;на покидающих&nbsp;&quot;яблочные&quot; компьютеры Intel Core.</p>\r\n\r\n<p>Чего мы не видим в этом рейтинге, составленном по продажам, - так это моделей <a href=\"/how/Nb/4#models\">имеющих стикер Intel Evo</a> -&nbsp;реинкарнации концепции, близкой к Ultrabook в ее изначальном варианте. Не мудрено: такие элитарные продукты крайне дороги. Их&nbsp;продаются не много.</p>\r\n\r\n<p><a href=\"#evo\">Но мы все-таки отыскали в статистике наиболее успешные из них.</a></p>\r\n\r\n<h3>Лидер: HP 14s-fq1</h3>\r\n\r\n<p><img alt=\"HP 14s-fq1\" src=\"/static/marketability/pict/rate/hp_14s-fq1.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p>Бюджетная модель построена на базе процессоров AMD Ryzen серии 5000U, известных под кодовым именем Lucienne. (Это последнее поколение массовых мобильных чипов AMD построенных на архитектуре Zen 2, то есть, фактически идентичных семейству&nbsp;предыдущего поколения 4000U-Picasso.)&nbsp;</p>\r\n\r\n<p>Цены на модель разнятся от ~40 тыс. руб. за конфигурацию с Ryzen 3 / 8 ГБ ОЗУ; до 55 тыс руб. за Ryzen 7 / 16 ГБ.</p>\r\n\r\n<p>Кстати, эта машина продается так хорошо, что входит и в общий <a href=\"/rate/Nb/3\">рейтинг популярности ноутбуков за май</a>, включающий ноутбуках всех типоразмеров. А прежнее поколение этой модели 14s-fq0 и вовсе стало <a href=\"/rate/Nb/1\">лидером российского рынка в апреле</a>.</p>\r\n\r\n<h3 id=\"evo\" name=\"evo\">Ноутбуки Evo</h3>\r\n\r\n<p>Evo - это спецификация Intel, определяющая широкий набор характеристик тонких и легких ноутбуков, способных сделать его действительно качественным. <a href=\"/how/Nb/4#certiif\">Полная версия спецификации Intel Evo</a> изложена в отдельной статье. Там же приведен и <a href=\"/how/Nb/4#models\">список актуальных моделей</a> ноутбуков с этим логотипом.</p>\r\n\r\n<p>Ну а здесь, мы лишь перечислим пятерку наиболее продаваемых&nbsp;ноутбуков с этим сертификатом.</p>\r\n\r\n<h4>Ноутбуки Intel Evo - лидеры продаж. Top-5:</h4>\r\n\r\n<ul>\r\n	<li><a href=\"/Nb/4881\"><strong>Lenovo ThinkBook 13s-ITL Gen2</strong></a></li>\r\n	<li><a href=\"/Nb/4844\"><strong>Asus ZenBook 14 Ultralight UX435E</strong></a></li>\r\n	<li><a href=\"/Nb/4831\"><strong>Acer Swift 3 SF314-59</strong></a></li>\r\n	<li><a href=\"/Nb/4810\"><strong>HP Spectre x360 13-aw2000</strong></a></li>\r\n	<li><a href=\"/Nb/4945\"><strong>HP Spectre x360 Convertible 14-ea0000</strong></a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбук для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?GO_ultrabook=Yes&amp;tabs=marketability\">Top-20 Ультрабуков</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?GO_ultrabook=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?GO_Game=Yes&amp;tabs=marketability\">Ультрабук</a></div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Intel Evo\" src=\"/static/marketability/pict/how/evo_case.jpg\" style=\"margin-bottom:10px; margin-top:10px; width:100px\" /></p>\r\n\r\n<p><a href=\"/how/Nb/4\">Intel Evo: что значит эта наклейка на корпусе ноутбука?</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Nb\" src=\"/static/marketability/pict/rate/hp_15s-eq1.jpg\" style=\"width:100px\" /></p>\r\n\r\n<p><a href=\"/rate/Nb/3\">Ноутбуки - лидеры продаж в России, Рейтинг, Top-10, Май, 2021</a></p>','Nb','2021-07-15','/static/marketability/pict/rate/ultrabooks1.jpg',1),(5,'5','Рейтинг популярности недорогих персональных принтеров. Июнь`2021','Рейтинг популярности недорогих лазерных принтеров A4. Июнь. Россия.','Недорогие персональные принтеры остаются одними из наиболее популярных печатающих устройств, и в настоящее время монохромные модели со скоростью печати до 20 стр./мин составили половину всех проданных лазерных принтеров. 	\r\nВ десятку наиболее продаваемых в июне персональных принтеров вошли модели начального уровня ведущих производителей лазерных устройств Brother, Canon, HP, Pantum  и Xerox.','<p>Недорогие персональные принтеры остаются одними из наиболее популярных печатающих устройств, и в настоящее время монохромные модели со скоростью печати до 20 стр./мин составили половину всех проданных лазерных принтеров.</p>\r\n\r\n<p><img alt=\"Pantum 2207\" src=\"/static/marketability/pict/rate/pantum_2207.jpg\" style=\"margin-left: 10px; margin-right: 10px; float: left; width: 200px; height: 146px;\" />В десятку наиболее продаваемых в июне персональных принтеров вошли модели начального уровня ведущих производителей лазерных устройств Brother, Canon, HP, Pantum &nbsp;и Xerox.</p>\r\n\r\n<p>Все монохромные модели имеют формат А4 и обладают базовой функциональностью и подключаются к компьютеру через порт USB. Принтеры HP Laser 107w, HP LaserJet M15w и Brother HL-1223WR оснащены интерфейсом Wi-Fi и могут работать в беспроводной сети.</p>\r\n\r\n<h2>Рейтинг популярности недорогих лазерных&nbsp;принтеров по продажам в Июне`2021</h2>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<th>Цена, руб.</th>\r\n			<th>Скорость,<br />\r\n			стр/мин</th>\r\n			<th>Wi-Fi</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4960\" target=\"_blank\">Pantum P2200</a></th>\r\n			<td>5393</td>\r\n			<td>20</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th>♔&nbsp;<a href=\"https://allgid.ru/Mfp/4961\" target=\"_blank\">Pantum P2207</a></th>\r\n			<td>5557</td>\r\n			<td>20</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4670\" target=\"_blank\">HP Laser 107a</a></th>\r\n			<td>7512</td>\r\n			<td>20</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/5050\" target=\"_blank\">Xerox Phaser 3020BI</a></th>\r\n			<td>7768</td>\r\n			<td>20</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/5111\" target=\"_blank\">HP LaserJet M15a</a></th>\r\n			<td>8193</td>\r\n			<td>18</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4385\" target=\"_blank\">Brother HL-1110R</a></th>\r\n			<td>8549</td>\r\n			<td>20</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4671\" target=\"_blank\">HP Laser 107w</a></th>\r\n			<td>8613</td>\r\n			<td>20</td>\r\n			<td>Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/5112\">HP LaserJet M15w</a></th>\r\n			<td>9083</td>\r\n			<td>18</td>\r\n			<td>Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4388\">Brother HL-1223WR</a></th>\r\n			<td>10283</td>\r\n			<td>20</td>\r\n			<td>Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4474\">Canon LBP6030B</a></th>\r\n			<td>12611</td>\r\n			<td>18</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>⚠&nbsp;Список моделей отсортирован по возрастанию цены, однако самые дешевые устройства не всегда являются и наиболее популярными</p>\r\n</div>\r\n\r\n<h3>Общая стоимость владения за длительный период</h3>\r\n\r\n<p><strong>TCO</strong> <em><strong>(Total Cost of Ownership)</strong></em> - Совокупная стоимость владения.</p>\r\n\r\n<p>Кроме того, у лазерных принтеров начального уровня обычно самая <strong>высокая стоимость вывода страницы</strong>, поэтому при достаточно интенсивной печати стоит обращать внимание на такой показатель, как общие затраты, понесенные за определенный период использования принтера.</p>\r\n\r\n<div class=\".inarticle_cit1\">\r\n<p>(Естественно,что&nbsp;&nbsp;при нерегулярной печати одной-двух страниц в день на этот показатель обращать внимание не стоит, поскольку основной статьей расходов в этом случае является приобретение самого принтера).</p>\r\n</div>\r\n\r\n<p>При составлении рейтингов модели сравниваются по трем критериям:</p>\r\n\r\n<p>- по популярности (количеству проданных устройств за данный месяц);</p>\r\n\r\n<p>- по средней цене;</p>\r\n\r\n<p>- по общим затратам на приобретение и эксплуатацию моделей (в данном случае &ndash; за 3 года при печати в среднем &nbsp;300 страниц в месяц).</p>\r\n\r\n<h2>Популярные&nbsp;лазерные принтеры&nbsp;&nbsp;по стоимости владения,&nbsp;&nbsp;по цене и по продажам<br />\r\n&nbsp;</h2>\r\n\r\n<table class=\"inarticle_table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>По продажам (По убыванию в шт.)</th>\r\n			<th>По цене (По возрастанию)</th>\r\n			<th>По стоимости владения.<br />\r\n			(По возоастанию TCO)</th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4961\" target=\"_blank\">Pantum P2207</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4960\" target=\"_blank\">Pantum P2200</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4960\" target=\"_blank\">Pantum P2200</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4671\" target=\"_blank\">HP Laser 107w</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4961\" target=\"_blank\">Pantum P2207</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4961\" target=\"_blank\">Pantum P2207</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/5050\" target=\"_blank\">Xerox Phaser 3020BI</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4670\" target=\"_blank\">HP Laser 107a</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4474\">Canon LBP6030B</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4670\" target=\"_blank\">HP Laser 107a</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/5050\" target=\"_blank\">Xerox Phaser 3020BI</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/5050\" target=\"_blank\">Xerox Phaser 3020BI</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4474\">Canon LBP6030B</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/5111\" target=\"_blank\">HP LaserJet M15a</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4385\" target=\"_blank\">Brother HL-1110R</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4960\" target=\"_blank\">Pantum P2200</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4385\" target=\"_blank\">Brother HL-1110R</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4670\" target=\"_blank\">HP Laser 107a</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/5112\">HP LaserJet M15w</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4671\" target=\"_blank\">HP Laser 107w</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4388\">Brother HL-1223WR</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/5111\" target=\"_blank\">HP LaserJet M15a</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/5112\">HP LaserJet M15w</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4671\" target=\"_blank\">HP Laser 107w</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4385\" target=\"_blank\">Brother HL-1110R</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4388\">Brother HL-1223WR</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/5111\" target=\"_blank\">HP LaserJet M15a</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"https://allgid.ru/Mfp/4388\">Brother HL-1223WR</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/4474\">Canon LBP6030B</a></th>\r\n			<th><a href=\"https://allgid.ru/Mfp/5112\">HP LaserJet M15w</a></th>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>&nbsp;</p>\r\n</div>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mfp/?tabs=marketability\">Выбрать принтер или МФУ для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Mfp/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Mfp/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mfp/?1+Принтеры=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">Выбрать лазерный принтер</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mfp/1+Принтеры=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mfp/?1+Принтеры=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">Лазерный</a></div>\r\n</div>','Mfp','2021-08-10','/static/marketability/pict/rate/pantum_2207.jpg',0),(6,'6','Представляем самые популярные игровые мониторы летом 2021.','Рейтинг популярности игровых мониторов. Июнь, 2021, Россия','Среди игровых мониторов наивысшую категорию составляют модели с диагональю от 32 дюймов, с вогнутым экраном и разрешением 4К. Цены на такие мониторы составляют от 30 до 44 тыс. рублей.','<p>По данным аналитической компании ITRsearch, на российском рынке в июне самыми популярными были <a href=\"/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;tabs=marketability\" target=\"_blank\">следующие 20 моделей мониторов</a>.&nbsp;</p>\r\n\r\n<p>Стоимость их составляли от 8 785 рублей за <strong><a href=\"/Mnt/2702\" target=\"_blank\">Acer ED246Ybi</a></strong><a href=\"/Mnt/2702\" target=\"_blank\"><strong>x</strong></a> (24&quot;) до&nbsp;&nbsp;28 500&nbsp;рублей за <strong><a href=\"/Mnt/2800\" target=\"_blank\">Acer VG252QXbmiipx</a> (25&quot;).</strong></p>\r\n\r\n<h2><b>Старший геймерский сегмент</b></h2>\r\n\r\n<p>Среди игровых мониторов наивысшую категорию составляют модели с диагональю от 32 дюймов, с вогнутым экраном и 4К разрешением. <a href=\"/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\" target=\"_blank\">Лучшая двадцатка&nbsp;июня в этом классе</a>.</p>\r\n\r\n<p>Цены на такие мониторы составляют от 30 до 180 тыс. рублей.</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mnt/?tabs=marketability\">Выбрать монитор для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Mnt/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Mnt/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mnt/?Игровой=Yes&amp;tabs=marketability\">Top-20 игровых моделей</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mnt/?Игровой=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mnt/?Игровой=Yes&amp;tabs=marketability \">Игровой</a></div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">Top-20 игровых моделей c вогнутыми экранами 4K</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability \">Игровой</a></div>\r\n</div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"https://allgid.ru/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"https://allgid.ru/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">Большой</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"https://allgid.ru/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"https://allgid.ru/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">Вогнутый</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"https://allgid.ru/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"https://allgid.ru/Mnt/?%D0%98%D0%B3%D1%80%D0%BE%D0%B2%D0%BE%D0%B9=Yes&amp;4K+%D0%BC%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80=Yes&amp;%D0%92%D0%BE%D0%B3%D0%BD%D1%83%D1%82%D1%8B%D0%B9=Yes&amp;%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9=Yes&amp;tabs=marketability\">4K</a></div>\r\n</div>','Mnt','2021-08-03','/static/marketability/pict/rate/mon_acer.jpg',0),(7,'7','Рейтинг недорогих принтеров для малых рабочих групп. Июль`2021','Недорогие монохромные лазерные принтеры для небольших офисов или малых рабочих групп с умеренными объемами печати.','Приводится актуальный top10 по реальным продажам в категории \"Недорогие монохромные принтеры производительностью 25 – 30 стр/мин\". Такие устройства часто используются в небольших офисах или малых рабочих группах с умеренными объемами печати.\r\nВсе принтеры имеют формат А4, поддерживают автоматическую двухстороннюю печать и обеспечивают работу в сети (оснащены интерфейсом Ethernet, Wi-Fi  или обоими).','<p>Недорогие монохромные принтеры производительностью 25 &ndash; 30 стр/мин и способные работать в проводных или беспроводных сетях часто используются в небольших офисах или малых рабочих группах с умеренными объемами печати.</p>\r\n\r\n<p>В десятку наиболее продаваемых в июле устройств этой категории вошли модели компаний Brother, Canon, HP, Kyocera, Pantum &nbsp;и Xerox. Все принтеры имеют формат А4, поддерживают автоматическую двухстороннюю печать и обеспечивают работу в сети (оснащены интерфейсом Ethernet, Wi-Fi &nbsp;или обоими).&nbsp;</p>\r\n\r\n<h2>Рейтинг популярности монохромных (черно/белых) лазерных принтеров с производительностью 25-30 стр. мин. Июль`2021</h2>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<th>Цена*, руб.</th>\r\n			<th>Скорость печати, стр./мин.</th>\r\n			<th>Подключение к сети</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4965\">Pantum&nbsp;P3010dw</a></th>\r\n			<td><strong>8&nbsp;419</strong></td>\r\n			<td style=\"text-align: center;\">30</td>\r\n			<td>Wi-Fi</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"http://127.0.0.1:8000/Nb/5025\">♔</a>&nbsp;<a href=\"/Mfp/5048\">Xerox&nbsp;B210</a></th>\r\n			<td><strong>11&nbsp;065</strong></td>\r\n			<td style=\"text-align: center;\">30</td>\r\n			<td>Ethernet (RJ45), Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4394\">Brother HL-L2340DWR</a></th>\r\n			<td><strong>13&nbsp;355</strong></td>\r\n			<td style=\"text-align: center;\">26</td>\r\n			<td>Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4686\">HP LaserJet M203dn</a></th>\r\n			<td><strong>13&nbsp;449</strong></td>\r\n			<td style=\"text-align: center;\">28</td>\r\n			<td>Ethernet (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/5183\">HP LaserJet M211dw</a></th>\r\n			<td><strong>13 949</strong></td>\r\n			<td style=\"text-align: center;\">29</td>\r\n			<td>Ethernet (RJ45), Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4687\">HP LaserJet M203dw</a></th>\r\n			<td><strong>14&nbsp;715</strong></td>\r\n			<td style=\"text-align: center;\">28</td>\r\n			<td>Ethernet (RJ45), Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4395\">Brother HL-L2360DNR</a></th>\r\n			<td><strong>15&nbsp;705</strong></td>\r\n			<td style=\"text-align: center;\">30</td>\r\n			<td>Ethernet (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4463\">Canon LBP162dw</a></th>\r\n			<td><strong>16&nbsp;312</strong></td>\r\n			<td style=\"text-align: center;\">28</td>\r\n			<td>Ethernet (RJ45), Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4788\">Kyocera&nbsp;FS-1060DN</a></th>\r\n			<td><strong>16&nbsp;868</strong></td>\r\n			<td style=\"text-align: center;\">25</td>\r\n			<td>Ethernet (RJ45)</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4396\">Brother HL-L2365DWR</a></th>\r\n			<td><strong>16&nbsp;963</strong></td>\r\n			<td style=\"text-align: center;\">30</td>\r\n			<td>Ethernet (RJ45), Wi-Fi</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>⚠ Данные отсортированы по возрастанию цены.&nbsp;<br />\r\nЦены - средние розничные на середину Июля 2021. К настоящему моменту могут быть иные.&nbsp;<br />\r\nCамые дешевые устройства не всегда являются и наиболее популярными.&nbsp;</p>\r\n</div>\r\n\r\n<p><img alt=\"Xerox B210\" src=\"/static/marketability/pict/rate/xerox_b210.jpg\" style=\"margin-top: 10px; margin-bottom: 10px;\" /></p>\r\n\r\n<p><em><strong>Xerox B210 - лидер продаж в классе лазерных принтеров для малых рабочих групп в июле 2021 г.</strong></em></p>\r\n\r\n<h3>При составлении рейтингов модели сравниваются по трем критериям:</h3>\r\n\r\n<ul>\r\n	<li>&nbsp;&nbsp; &nbsp;по популярности (количеству проданных устройств за данный месяц);</li>\r\n	<li>&nbsp;&nbsp; &nbsp;по средней цене;</li>\r\n	<li>&nbsp;&nbsp; &nbsp;по общим затратам на приобретение и эксплуатацию моделей, ТСО (в данном случае &ndash; при регулярной печати в среднем по1000 страниц в месяц..</li>\r\n</ul>\r\n\r\n<p>1000 страниц в месяц, что можно считать достаточно умеренной интенсивностью для рабочих групп из 3 &ndash; 5 пользователей). Показатель ТСО определяется с учетом средних цен на устройства и оригинальные картриджи с максимальным для данной модели ресурсом.</p>\r\n\r\n<p>Ниже приведены все три рейтинга десятки самых популярных принтеров для малых рабочих групп, сведенные в одну таблицу.</p>\r\n\r\n<h2><br />\r\nРейтинги наиболее продаваемых моделей монохромных лазерных принтеров для малых рабочих групп по данным реальных продаж в России. Июль 2021 года.</h2>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\"><tв> </tв>\r\n\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>По популярности</th>\r\n			<th>По цене</th>\r\n			<th>По общим затратам за 3 года (TCO)</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"/Mfp/5048\">Xerox&nbsp;B210</a></th>\r\n			<th><a href=\"/Mfp/4965\">Pantum&nbsp;P3010dw</a></th>\r\n			<th><a href=\"/Mfp/4965\">Pantum&nbsp;P3010dw</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4965\">Pantum&nbsp;P3010dw</a></th>\r\n			<th><a href=\"/Mfp/5048\">Xerox&nbsp;B210</a></th>\r\n			<th><a href=\"/Mfp/4788\">Kyocera&nbsp;FS-1060DN</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4394\">Brother HL-L2340DWR</a></th>\r\n			<th><a href=\"/Mfp/4394\">Brother HL-L2340DWR</a></th>\r\n			<th><a href=\"/Mfp/4463\">Canon LBP162dw</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4686\">HP LaserJet M203dn</a></th>\r\n			<th><a href=\"/Mfp/4686\">HP LaserJet M203dn</a></th>\r\n			<th><a href=\"/Mfp/5048\">Xerox&nbsp;B210</a></th>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"/Mfp/4687\">HP LaserJet M203dw</a></th>\r\n			<th><a href=\"/Mfp/5183\">HP LaserJet M211dw</a></th>\r\n			<th><a href=\"/Mfp/4394\">Brother HL-L2340DWR</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4396\">Brother HL-L2365DWR</a></th>\r\n			<th><a href=\"/Mfp/4687\">HP LaserJet M203dw</a></th>\r\n			<th><a href=\"/Mfp/4395\">Brother HL-L2360DNR</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4788\">Kyocera&nbsp;FS-1060DN</a></th>\r\n			<th><a href=\"/Mfp/4395\">Brother HL-L2360DNR</a></th>\r\n			<th><a href=\"/Mfp/4396\">Brother HL-L2365DWR</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4395\">Brother HL-L2360DNR</a></th>\r\n			<th><a href=\"/Mfp/4463\">Canon LBP162dw</a></th>\r\n			<th><a href=\"/Mfp/4687\">HP LaserJet M203dw</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/5183\">HP LaserJet M211dw</a></th>\r\n			<th><a href=\"/Mfp/4788\">Kyocera&nbsp;FS-1060DN</a></th>\r\n			<th><a href=\"/Mfp/4686\">HP LaserJet M203dn</a></th>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Mfp/4463\">Canon LBP162dw</a></th>\r\n			<th><a href=\"/Mfp/4396\">Brother HL-L2365DWR</a></th>\r\n			<th><a href=\"/Mfp/5183\">HP LaserJet M211dw</a></th>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p><em>По <strong>критерию популярности</strong> модели располагаются в порядке убывания количества проданных устройств. Несмотря на принадлежность к одному классу и сходство технических характеристик и функциональных возможностей, объемы продаж таких принтеров существенно отличаются.<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nВ рейтингах <strong>по цене</strong> и <strong>общим затратам</strong> модели расположены в порядке возрастания соответствующего показателя. Здесь также разница между моделями оказывается весьма значительной. Так, например, показатель общих затрат (ТСО), может оказаться в условиях регулярной интенсивной печати более важным, чем стоимость самого устройства. &nbsp;Для приведенных выше бестселлеров рынка, уже через год использования &nbsp;затраты на их эксплуатацию могут превышать цену приобретения, в зависимости от модели, в 2 &ndash; 4 раза, а за три года &ndash; почти на порядок.</em><br />\r\n&nbsp;</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mfp/?tabs=marketability\">Выбрать монитор для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Mfp/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Mfp/?tabs=marketability\">ФИЛЬТР</a></div>\r\n\r\n<div class=\"fltr_text\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mfp/?1+Принтеры=Yes&amp;5+Монохромные=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">Top-20 Лазерных монохромных принтеров</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mfp/?1+Принтеры=Yes&amp;5+Монохромные=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mfp/?1+Принтеры=Yes&amp;5+Монохромные=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">Принтер</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mfp/?1+Принтеры=Yes&amp;5+Монохромные=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mfp/?1+Принтеры=Yes&amp;5+Монохромные=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">Лазерный</a></div>\r\n</div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mfp/?1+Принтеры=Yes&amp;5+Монохромные=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mfp/?1+Принтеры=Yes&amp;5+Монохромные=Yes&amp;3+Лазерные=Yes&amp;tabs=marketability\">Черно-белый</a></div>\r\n</div>','Mfp','2021-08-31','/static/marketability/pict/rate/xerox_b210.jpg',0),(8,'8','Лучший ИБП для дома, начального уровня, с IEC-розетками. Лето`2021','Летом 2021 наиболее популярной моделью ИБП для дома, начального уровня, с компьютерными розетками IEC, стал Ippon Back Basic 650. Рейтинги.','Летом 2021 наиболее популярной моделью ИБП для дома, начального уровня, с компьютерными розетками, стал Ippon Back Basic 650.','<p>По данным <a href=\"https://www.itbestsellers.ru\" target=\"_blank\">ITResearch</a> и <a href=\"https://allgid.ru\">&laquo;Гида Покупателя&raquo;</a> летом 2021 наиболее популярной моделью ИБП для дома, начального уровня, с компьютерными розетками, был <strong><a href=\"/Ups/857\" target=\"_blank\">Ippon Back Basic 650</a></strong>.</p>\r\n\r\n<p><img alt=\"Ippon Back Basic 650\" src=\"/static/marketability/pict/rate/ippon_back_basic_650.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 235px;\" /></p>\r\n\r\n<p>Он же - наиболее популярная массовая модель по рынку в целом.</p>\r\n\r\n<p><strong><a href=\"/Ups/?GO_lowend=Yes&amp;CL_iec=Yes&